@Dixy_Normiss @gdwestmoreland @newsmax From what I recall, Trump delayed the first "Fake China Virus" stimulus checks just so he could get his name on 'em. Now... what benefit would that have for him in 2020?

They weren't complaining about the handouts then, were they?

See, actual humans have a "memory." Bots don't.

@GibbsvilleMan Who would have guessed that Vanity Fair would publish a report written by GOP staffers, and then claim the VF article was an actual Senate Report?

The conclusion is "just raising questions, but no proof of our thesis...".

The lab in China should have enough data to resolve this
